    data: |
      SELECT * FROM tab2 (FORMAT parquet) WHERE NOT NULL NOT IN ( + 64, col0 * CAST ( col2 AS INTEGER ) * 26 + CAST ( + col1 AS INTEGER ) - col2 + + + col1 * + col2 * - - col1 * - + 42 * + col1 - col0 );
  - name: tab2

outputs:
  - name: q3401.out
    data: |
